import React from 'react';

const Card = ({ questions }) => {
    if (!questions) return <p>Loading...</p>;

    return (
        <div className='relative flex min-h-screen flex-col justify-center overflow-hidden bg-gray-50 py-6 sm:py-12'>
            <div>
                <p>{questions[0]}</p>
            </div>
        </div>
    );
}

export default Card;
